        video.loop = true;
        video.src = image1;
        video.load();
    
        var video2 = document.createElement('video');
        video2.autoplay = true;
        video2.loop = true;
        video2.src = image2;
        video2.load();
    
        var texture1 = new THREE.VideoTexture(video);
